  const [checkmate, setCheckmate] = useState(false);
  
  return (
    <div className="Chessboard">
      {checkmate ? <Chessboard id="Basicboard"/> : <Chessboard id="Basicboard" arePiecesDraggable={false}/>}
    </div>
  );
}
